INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Specify some ending characters if necessary.<br>Applied only when the text is truncated.<br>','1','1356733769MICT'),('Specify the number of digits to enter.<br>','1','1356733769MICV'),('Yes to have a click-able link.<br>No to simply show the link URL.<br>','1','1356733769MICW'),('Define the target windows when user click on the link.<br>','1','1356733769MICX'),('Define the text to appear for the link.<br>By default the URL of the link will be shown.<br>','1','1356733769MICY'),('By default a column can be sorted by clicking on the header of the column.<br>Click Yes to disable the sorting by this column.<br>','1','1356733769MICZ'),('Click Yes to remove the caption when the column is nested.<br>','1','1356733769MIDA'),('Click Yes show this column as an overlay of the current column value.<br>','1','1356733769MIDB'),('By default each nested column is separated by a return to the line.<br>However you can specify another character to separate the nested column ( e.g.: a space, to concatenate string )<br>','1','1356733769MIDC'),('Define the priority of the ordering of data.<br>','1','1356733769MIDD'),('Define the direction for the ordering of data.<br>','1','1356733769MIDE'),('Text Area','1','1356733769MIDK'),('New / Edit','1','1357059105KDVU'),('Single','1','1357059110IPWM'),('Multiple','1','1357059110IPWN'),('Specify the size of the input box in number of characters.<br>','1','1357059111JYQD'),('API Name','1','1357296145DBZG'),('API Key','1','1357296145DBZH'),('InfusionSoft Credential','1','1357296145DBZI'),('App Folder','1','1357309003EWPW'),('App Key','1','1357309003EWPX'),('App Secret','1','1357309003EWPY'),('- Select crendentials -','1','1357343462IBXT'),('Credential Type','1','1357948997CAPK'),('Credentials Types','1','1357948999CZIZ'),('Tab container','1','1358294811IVXF'),('Create column','1','1358294811IVXH'),('Create row','1','1358294811IVXI'),('Div container','1','1358294811IVXK'),('No Title