le or class to customize the CSS.<br><br>','1','1359486683BCQJ'),('Each \"Listing element\" represent a column into the listing.<br>You can change the ordering of each column or rename the header.<br><br>If the column is specified as searchable, the column will be automatically search when the user enter a keyword in the search box.<br>','1','1359486683BCQK'),('The information on the General tab is the same for any kind of listing element or column.<br>The Field Specific information depends on what type of field you are editing and for more detailed information please refer to the documentation.<br>The attribute let you change the rendering of the column, for instance changing the data sorting or created nested column.<br>The Style tab let you specify some specific style or class to customize the CSS. It allows also to change the column alignment and width.<br><br>','1','1359486683BCQL'),('This is a list of all button for your view.<br>You can change order, rename button or modify the access level of a button.<br>If you unpublish a button it will not longer be accessible to the user.<br>','1','1359486683BCQM'),('Use as Parent','1','1360166005IDUM'),('Let you define this container field as a parent for the custom fields.<br>If different than zero this container will appear in the possible container in the custom field form.<br>The value indicate the order in which it will appear.<br>','1','1360166005IDUN'),('Translated Text Area','1','1360193670QXOO'),('Visible & Order','1','1360240327QUAB'),('duration','1','1360289390KMBD'),('Count down','1','1360289390KMBE'),('minutes','1','1360366414NJAI'),('seconds','1','1360366414NJAJ'),('stop','1','1360366414NJAK'),('Use SSL','1','1360366419PVEQ'),('Bucket Name after /','1','1360366419PVER'),('Default No, define how to write the URL. The bucket name will be in the beginning of the URL before the dot.<br>Yes to put the bucket name after the /.<br>Do not change this setting if you are not sure.<br>','1','1360366420ERXG'),('The font file for the captcha could not be found!','1','1360630221KYCU'),('The file could not be writen on Amazon S3.','1','1360711865IYJW'),('The file could not be uploaded on Amazon S3.','1','1360711865IYJX'),('Select a type','1','1360922680DLQR'),('Reserved Pick-list','1','1360922681PNPQ'),('The GD library needs to be installed!','1','1369749782AJAF'),('To restore a view that you deleted, simply re-install the application.','1','1370648536RVAD'),('Delete an entire view','1','1370648554FHZC'),('IPs','1','1373209080EJXY'),('Google Credential','1','1373209081MPUH'),('The map feature requires PHP 5.3 or higher.','1','1373209094YQB'),('Up To Now','1','1373935459SQDD'),('Chart','1','1374276934ANBO'),('Mailing queue','1','1374608348GDGV'),('Trigger the processing of the mailing queue.','1','1374608348GDGW'),('Mails','1','1375971621IIJU'),('If you do not know what you are doing do not touch the settings below. You can damage your application!','1','1375977738AJMS'),('Read the documentation for further information.','1','1375977738AJMT'),('The form element could not be saved because there is no reference to a view.','1','1375977746FUII'),('The menu could not be saved because there is no reference to a view.','1','1375977746FUIJ'),('Allow you to add formatted time in any content.','1','1377041362DLCC'),('Widget type','1','1377041435CPNQ'),('Widget Type','1','1377041435CPNR'),('2 Years ago','1','1377546988CHLS'),('3 Years ago','1','1377546988CHLT'),('Class suffix','1','1377703397QFCV'),('Module params','1','1377703397QFCW'),('We need a dummy param so that the form get saved.<br>Since we have a nested form with params.<br>','1','1377744895PJNN'),('Modified date','1','1379004130IRAI'),('Define the required role to see the widget.<br>','1','1379004885AWBD'),('This name might be shown to the user is the preferences is set to do so.<br>','1','1379004885AWBE');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('If not specified the name will be used. The alias is only used for administration purpose to identify the widget, when many of them have similar names.<br>','1','1379004885AWBG'),('Detailed description of the widget purpose.<br>','1','1379004885AWBH'),('Time widget','1','1379006374DSAT'),('Choose type','1','1379039266OOHC'),('Insert Widget','1','1379039270QKLD'),('Insert widget','1','1379039272DOEH'),('Click on the link to insert the widget','1','1379039272DOEI'),('- Select usage -','1','1379525589DYXL'),('Usage','1','1379525590FHQN'),('Widget\'s Types','1','1379614096IGWC'),('Discussions','1','1380027946LBCD'),('WidgetBox','1','1380064816PMFL'),('Joomla Module','1','1380064816PMFM'),('Simple Div','1','1380064816PMFN'),('Optional: add a class suffix to differentiate the widget from others.<br>','1','1380064817JISO'),('Test e-mail sent from {widget:sitename}','1','1380064818QMSW'),('New updates are available on {widget:param|name=site} !','1','1380064818QMSX'),('<p>An email has been sent with the following information:</p><p><br></p><p>Email: {widget:param|name=email}</p><p>Subject: {widget:param|name=subject}</p><p>Body: {widget:param|name=body}</p><div><br></div><div><br></div><p><br></p><div style=\"text-align: center;\"><a href=\"http://www.joobi.co/\" title=\"Joobi\">Powered by Joobi</a></div>','1','1380064818QMSY'),('<p>Hi {widget:name},</p><p>There are new updates on your website.<br><br>New updates available:<br><br></p><ul><li>{widget:param|name=applicationupdates}</li></ul><p><br>New apps available:<br><br></p><ul><li>{widget:param|name=newapplications}</li></ul><p><br><br>Enjoy!<br><br><br><span style=\"text-decoration: underline;\">Information:</span> To turn off this reminder you have an option in jCenter-&gt;Preferences-&gt;Advance<br><br></p><div style=\"text-align: center;\"><a href=\"http://www.joobi.co\" title=\"Joobi\">Powered by Joobi</a></div>','1','1380064818QMSZ'),('The page widget can only be used with PHP 5','1','1380143302RHWW'),('Please specify the url of the page you want to include','1','1380143302RHWX'),('Can not load the page $URL','1','1380143302RHWZ'),('Any time','1','1380228948FANI'),('Only new','1','1380228948FANJ'),('Only edit','1','1380228948FANK'),('Menus Elements','1','1380567395OUTJ'),('Form elements','1','1380567395OUTK'),('Time zone','1','1380567395OUTL'),('Enter a string containing an English date format.<br>eg: 10 September 2000<br>+1 day<br>+1 week 2 days 4 hours 2 seconds<br>next Thursday<br>last Monday<br>Use now or empty for the current time.<br>','1','1380567396OSFZ'),('Choose the format of the date to render.<br>','1','1380567396OSGA'),('Choose the timezone to use.<br>','1','1380567396OSGB'),('Preferences List','1','1380567396OSGC'),('How to insert the widget?','1','1380567396OSGD'),('Advance Search','1','1382068744SDQH'),('Defines if the column should be searchable. If any column is searchable a search box will appear automatically.<br>','1','1384994595QDWU'),('Refresh Captcha','1','1391449458SRZS'),('Clean Email Statistics','1','1391607531FXMD'),('Delete the email statistics older than a predefine period.','1','1391607531FXME'),('Row 1','1','1392733055LQQF'),('Row 2','1','1392733055LQQG'),('Light Blue','1','1393290131DEFB'),('Basic','1','1393515934QLIQ'),('Honrizontal','1','1393515934QLIR'),('Inline','1','1393515934QLIS'),('column1','1','1394069593IQAS'),('column2','1','1394069593IQAT'),('Loading','1','1395500509GSSS'),('Pane container','1','1395500511PPJW'),('Collapsable Pane container','1','1395500511PPJX'),('Joomla 3.2 Responsive Theme','1','1395500527LEDU'),('Color','1','1395886787SVJW'),('Rounded','1','1396671423GHXG'),('Circle','1','1396671423GHXH'),('On-Input','1','1396671424DMOJ'),('On-Name','1','1396671424DMOK'),('Panel','1','1396671424DMOL'),('Box','1','1396671424DMOM'),('Large','1','1396671424DMOP'),('Token not valid to get original files, it requires a valid plan.','1','1398110833SALX'),('Action