ine on what device the menu will be visible.','1','1409709084ILIX'),('Define on what device the menu will be hidden.','1','1409709084ILIY'),('Define on what device the column will be visible.','1','1409709084ILIZ'),('Define on what device the column will be hidden.','1','1409709084ILJA'),('There is no type of $TYPEpublished so the system got one by default.','1','1410185409ETKT'),('1413402828','1','1413480085HVBR');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Select Model','1','1414093502MVHU'),('Define the type of column.','1','1414104730SWZC'),('Joomla 1.6','1','1414744016SROW'),('Joomla 3.0','1','1414744016SROX'),('WordPress 4','1','1414744016SROY'),('Mobile V.1','1','1414744016SROZ'),('Netcom','1','1414744016SRPA'),('Users\' Sessions','1','1414744018EIML'),('Mobile Specific','1','1415125832CRQP'),('Yes, to show the column header in the listing.','1','1415125832CRQQ'),('Tooltip Style','1','1415377877PTRF'),('Tips Above Field','1','1415378020IIPY'),('Tips Below Field','1','1415378020IIPZ'),('Choose the tooltip style','1','1415378022OZRU'),('<p>This e-mail has been sent at <span style=\"font-weight: bold;\">{widget:time} </span>from the website <span style=\"font-weight: bold;\">{widget:sitename} </span>( {widget:site} ) to test your mail configuration.<br /><br /></p>\r\n<div style=\"text-align: center;\"><span style=\"color: #cc0000; font-weight: bold;\">If you receive this e-mail, it means that you will be able to send any other e-mail from the website.</span></div>\r\n<p><br /><br /><br /><br /><br /></p>\r\n<div style=\"text-align: center;\"><a href=\"http://www.joobi.co/\" title=\"Joobi\">Powered by Joobi</a></div>','1','1415654678EXBP'),('An e-mail has been sent by API to {widget:param|name=email}','1','1415678513OMNE'),('1415663813','1','1415678513OMNF'),('Configuration','1','1416665748MZJC'),('Type the proof here','1','1416948592JPZB'),('This is the configuration pane, and it is visible only by the Administrator!','1','1416948594GBIZ'),('Below you will find all the Preferences used to render the page.','1','1416948594GBJA'),('If you do not get the expected result, verify all the Preferences are in accordance with the desired setup.','1','1416948594GBJB'),('View details','1','1416948594GBJC'),('Is Core','1','1416948594GBJD'),('Pane','1','1416948599JVQT'),('The main theme to integrate Joobi Apps to Joomla 3.2.\r\nThe theme responsive and built with bootstrap.','1','1416948600KVDI'),('Are you sure you want to RE-Core the View? If the view is set back to a core view the custom fields on that view will be lost and will have to be added again to the view.','1','1417652012LVWX'),('Example : {widget:page|url=\"http://www.joobi.co\"}','1','1418159563RQJB'),('This is a list of all \"form elements\" or also called fields in the form.<br>The indentation represent the hierarchy of elements. There are elements that we call \"layout element\" like Tabs, Fieldset, and others which are used to define the layout of your form. Those you can modification and even create new ones.<br>The other elements are used to hold you data.<br><br>The area represent the specific area in the theme where the field will be rendered. Those area can be modified in the themes.<br><br>The type is there for information and can\'t not be changed.<br><br>If you unpublish an element it will not be visible to the user any more.<br>','1','1418159573ASQG'),('Create a link field. \r\nEnable to enter an URL.\r\nDisplay a click-able link.','1','1418159573ASQH'),('Bootstrap','1','1418398780RXKS'),('Color picker','1','1418398780RXKT'),('WordPress','1','1418690424RJPQ'),('None SEF URL','1','1419342002KFBC'),('Cache $FOLDER successfully deleted!','1','1420121260PTWF'),('All the cache has been deleted!','1','1420121260PTWG'),('Now you can click on \"Restore\" button to restore the view!','1','1420854481TJBT'),('The views have been successfully restored!','1','1420854481TJBU'),('The view has been successfully restored!','1','1420854481TJBV'),('Buttons & Header','1','1421684732GOVY'),('Define how the buttons and the title of the page should be presented.','1','1421684733OMTP'),('No Header, No Title, No Menu','1','1421684737PPWJ'),('Just Title','1','1421684737PPWK'),('Title - Top Menu','1','1421684737PPWL'),('No Title - Top Menu','1','1421684737PPWM'),('Title - Top & Bottom Menu','1','1421684737PPWN'),('No Title - Top & Bottom Menu','1','1421684737PPWO'),('Title - Bottom Menu','1','1421684737PPWP'),('No Title - Bottom Menu','1','1421684737PPWQ'),('The proof value entered is not correct!','1','1423415282OGNM'),('Proof is Correct!','1','1423415282OGNN'),('The main theme to integrate Joobi Apps to WordPress native theme.','1','1423683949RWKE'),('Solve this question please','1','1424997296GVOP'),('Lowest value','1','1424997296GVOQ'),('Highest value','1','1424997297STJG'),('Re-Captcha','1','1424997302FRPR'),('Site Key','1','1425007246IWYI'),('Google reCaptcha','1','1425007249TGNU'),('Math','1','1425008364MFCI'),('WordPress 4 Native Theme','1','1425043740DAHV'),('WordPress 4 Bootstrap Responsive Theme','1','1425043740DAHW'),('A theme specially designed to support WordPress theme designed with Bootstrap','1','1425043741BMAQ'),('<b><font color=\"#cc0000\">In most of the case leave this empty.</font>&nbsp;</b><div>If you have a different end point than&nbsp;s3.amazonaws.com, you can specify it here.<div><br></div></div>','1','1425489474KFSW'),('reCaptcha require a Site Key! Once you have the keys please enter them into the Credentials menu in the administrator area of your site.','1','1425922198CPJX'),('Virtuemart 3 Starter Theme','1','1426258023BVGO'),('A Joobi store theme specifically designed to integrate to Virtuemart 3 theme styles. \r\nIt uses Virtuemart classes to get started with your theme customization using Joomla templates designed for Virtuemart.\r\nIt allows you to use any Virtuemart 3 compatible templates within the Joobi eCommerce Applications.','1','1426258023BVGP'),('php-xml extension is not installed in your PHP server, it is highly recommanded.','1','1433250437OEYO'),('The plugin \"Joobi - Repalce Widgets in Articles\" is not published!','1','1434036710ZKH'),('Make sure to publish the plugin for the widget to work!','1','1434036710ZKI'),('The header of the view.','1','1434680167LAGD'),('Define the tips or description of the field.','1','1434680167LAGE'),('The title of the wizard','1','1434680167LAGF'),('Specify a file name&nbsp;','1','1434764997FCPY'),('Define a file name where to PHP code will be saved.','1','1434764997FCPZ'),('Custom','1','1434764999FJEM'),('Custom PHP','1','1434765001GPUG'),('Field enabling to write some PHP code.','1','1434765001GPUH'),('Write PHP code','1','1434767164BOLQ');
